import './Freetrial.scss'
import {useState} from 'react'
import Footer from "components/footers/MiniCenteredFooter.js";

function Freetrial() {
  return (
    <div className='free'>
        <div className='wrapper'>
          <div className="text">

          </div>
          </div> 

          <Footer />   
    </div>

  )
}

export default Freetrial
